import React from "react";
import NavBar from './components/navigation/NavBar';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.express));
  }, []);

  return (
    <>
      <NavBar/>
    </>
  );
}

export default App;
